import React, { Component } from 'react';
import './resume_style.css';

class Portfolio extends Component {

  render() {
    return (
    	<React.Fragment>
            <h1>MY RESUME</h1>
            <br/><br/>
            <h3>- - - EDUCATION - - -</h3>
            <br/>
            <div className='main'>
                <div className='block1'></div>
                <div className='block2'></div>
                <div className='line'></div>
            </div>
            <h3>- - - EXPERIENCE - - -</h3>
            <br/>
            <div className='main'>
                <div className='block1'></div>
                <div className='block2'></div>
                <div className='line'></div>
            </div>
    	</React.Fragment >
    );
  }
}

export default Portfolio;
